import React from 'react';
import '../styles/home.css';


const Home = () => {
  return (
    <body>
      <div className='home-container'>
        <img src="home-container-image" alt="home-container-image" className='home-container-image'/>
        <div className='home-section'>
            <h4 className='home-section-title'>Hello There ,</h4>
            <h5 className='home-section-subtitle'>We are creating amazing websites and mobile applications!</h5>
            <h6 className='home-section-text'>I hope we can help you!</h6>
            <button className='home-section-button'>Check Our Projects</button>
        </div>
      </div>
    </body>
  );
};

export default Home;
